	<text transform="matrix(1 0 0 1 692.4004 66.2236)" fill="#434744" font-family="Catamaran" font-size="14.1732">Gefeliciteerd, je bent een</text>
</g>
<g>
	<rect x="692.4" y="155.641" fill="none" width="229.571" height="247.59"/>
	<text transform="matrix(1 0 0 1 692.4004 165.9297)"><tspan x="0" y="0" fill="#434744" font-family="Catamaran" font-size="14.1732">Je hebt het overleefd: zowel de wereld </tspan><tspan x="0" y="17.008" fill="#434744" font-family="Catamaran" font-size="14.1732">als je bedrijf draaien nog. Van het </tspan><tspan x="0" y="34.016" fill="#434744" font-family="Catamaran" font-size="14.1732">grote bedrijf van weleer is weinig over, </tspan><tspan x="0" y="51.023" fill="#434744" font-family="Catamaran" font-size="14.1732">maar milieuclubs houden van je. </tspan><tspan x="0" y="68.031" fill="#434744" font-family="Catamaran" font-size="14.1732">Geniet ervan, topman! Dat lawaai </tspan><tspan x="0" y="85.039" fill="#434744" font-family="Catamaran" font-size="14.1732">daarboven is van opstandige </tspan><tspan x="0" y="102.047" fill="#434744" font-family="Catamaran" font-size="14.1732">aandeelhouders die hun geld </tspan><tspan x="0" y="119.055" fill="#434744" font-family="Catamaran" font-size="14.1732">terugeisen.</tspan><tspan x="0" y="153.07" fill="#434744" font-family="Catamaran" font-size="14.1732">Was dit een spelletje? Topmannetje is </tspan><tspan x="0" y="170.078" fill="#434744" font-family="Catamaran" font-size="14.1732">gebaseerd op research van </tspan><tspan x="0" y="187.086" fill="#434744" font-family="Catamaran" font-size="14.1732">onderzoeksjournalisten van Investico. </tspan><tspan x="0" y="221.103" fill="#434744" font-family="Catamaran" font-size="14.1732">Lees hier het hele, echte verhaal.</tspan></text>
</g>
